import React from 'react';
import DataEntry from './DataEntry';

export const DataHeader = (props) => {
  const { dataEntries, datePicker } = props;
  if (dataEntries !== undefined) {
    return (
      <div>
        <table className="centered highlight responsive-table grey myTable">
          {/** Pending table sorting here */}
          <thead>
            <tr>
              <th className="sorter-false">Test Number</th>
              <th>Actual MAC Address</th>
              <th>Spoofed MAC</th>
              <th>AP Name</th>
              <th>AP BSSID</th>
              <th>Gateway Address</th>
              <th>Google Avg Ping/ms</th>
              <th>Google DNS Avg Ping/ms</th>
              <th>Gateway Avg Ping/ms</th>
              <th>HTTP Response</th>
              <th>RSSI/dBm</th>
              <th>Signal Strength/%</th>
              <th>Frequency/Hz</th>
              {/* <th>Authentication Time/sec</th> */}
              <th>Date tested</th>
            </tr>
          </thead>
          <tbody>
          { dataEntries && dataEntries.map((entry, index) => {
            return (<DataEntry dataEntry={entry} key={index} dateRange={datePicker} testNum={index}></DataEntry>)
          }) }
          </tbody>
        </table>
      </div>
    )
  } else {
    return (
      <div>
        <p> No Data to show </p>
      </div>
    )
  }
}
